query MediumPosts {
  allMediumPost(sort: {fields: [createdAt], order: DESC}) {
    edges {
      node {
        id
        title
        uniqueSlug
        virtuals {
          totalClapCount
          subtitle
          previewImage {
            imageId
          }
        }
      }
    }
  }
}

